script: |
  super -f text -I q3533.spq | sort > q3533.out

inputs:
  - name: q3533.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE ( NOT - 18 * col0 IN ( col2, col1, col0, - ( - col1 ), - 54, + col1, col2 + + col0 * - col1 * - 97 * + ( + col2 ) - col1 + - - col0 * - col2 ) );
  - name: tab1

outputs:
  - name: q3533.out
    data: |
      51	14	96
      85	5	59
      91	47	68
